const AboutPage = () => {
  return(
    <>
    <h1>About Us</h1>

    <h3>Who we are</h3>
    <p class="centered"> The 302 is your online hub for all things tech-related. You'll find
    the latest news and expert opinions on the latest and greatest in the industry.
    We cover a host of different topics such as smartphones, laptops, operating
    sytems, and more. </p>

    <hr />

    <h3>Our Writers</h3>
    <h4>Blake Tharp</h4>
    <p class="centered">Blake Tharp is a skilled IT professional and writer with over 5 years of industry experince providing.
    in-depth knowledge to people from any background.</p>
    <p class="centered">When he is not writing for providing quality technical support or programming websites you can finding him
    stuck in a good book, playing with his dog Bowie, or spending time with his wife Emily.</p>


    </>
  );
}

export default AboutPage;
